import React,{Component} from 'react';
import {Button,Icon} from 'semantic-ui-react'

class ViewSeat extends Component{

	render(){

		return(
			<Button color='red'>
				<Icon name='ticket'/>
				{this.props.seat}
			</Button>
		)
	}
}

export default ViewSeat;
